package p1513

import (
	"fmt"
	"testing"
)

func TestNumSub(t *testing.T) {
	cases := []struct {
		input string
		expected int
	} {
		{
			input: "0110111",
			expected: 9,
		},
		{
			input: "101",
			expected: 2,
		},
		{
			input: "111111",
			expected: 21,
		},
		{
			input: "",
			expected: 200542505,
		},
	}

	for i, c := range cases {
		t.Run(fmt.Sprintf("Case %d", i), func(t *testing.T) {
			result := numSub(c.input)
			if result != c.expected {
				t.Errorf("Expected %d; got %d", c.expected, result)
			}
		})
	}
}
